import './App.css';
import React, { Component } from 'react'

class App extends Component {

  url = 'http://localhost:8080/user/alex'
  name = ''
  state = {
    users: []
  }

  componentDidMount() {
    fetch(this.url, {method: 'POST'})
    .then(res => res.json())
    .then((data) => {
      this.setState({users: [...this.state.users, data]})
      this.render()
    })
    .catch(console.log)
  }

  render() {

    console.log('state: ', this.state.users)

    return (
      <div className="App-header">
          {this.state?.users.forEach((user, i) => <div key={i}> {user.id} </div>)} 
      </div>
    )

  }
}

export default App;
